import '../styles/ColecoesDestaque.css';
import shoeCard from '../assets/shoe-cards.png';
import shirt from '../assets/shirt.png';
import headphone from '../assets/headphone.png';
import redShirt from '../assets/red-shirt.png';
import pants from '../assets/pants.png';
import smallheadphone from '../assets/smallheadphone.png';
import sneakers from '../assets/sneakers.png';

export default function Destaque() {
    return (
        <>
            <section className="section-destaque">
                <div className="divDestaque">
                    <p className="paragrafoColecao">Coleções em destaque</p>
                    <div className="divDestaque1">
                        <div className="divDestaquePromo1">
                            <div className="textoDestaque">
                                <p className="paragrafoDestaque">30% OFF</p>
                                <h3 className="h3Destaque">Novo drop Supreme</h3>
                                <a href="/produtos" className="botaoComprar">Comprar</a>
                            </div>
                            <img src={shirt} alt="Camiseta" />
                        </div>
                        <div className="divDestaquePromo1">
                            <div className="textoDestaque">
                                <p className="paragrafoDestaque">30% OFF</p>
                                <h3 className="h3Destaque">Coleção Adidas</h3>
                                <a href="/produtos" className="botaoComprar">Comprar</a>
                            </div>
                            <img src={shoeCard} alt="Tênis Branco" />
                        </div>
                        <div className="divDestaquePromo1">
                            <div className="textoDestaque">
                                <p className="paragrafoDestaque">30% OFF</p>
                                <h3 className="h3Destaque">Novo Beats Bass</h3>
                                <a href="/produtos" className="botaoComprar">Comprar</a>
                            </div>
                            <img src={headphone} alt="Headphone" />
                        </div>
                    </div>
                </div>
            </section>
            <section className="divDestaque2">
                <p className="colecaoP">Coleções em destaque</p>
                <div className="destaqueColecoes">
                    <div className="destaqueColecoes1">
                        <div className="divImagem">
                            <a href="/produtos"><img src={redShirt} className="colecoes" alt="Camiseta Vermelha" /></a>
                        </div>
                        <p className="itensDestaque">Camisetas</p>
                    </div>

                    <div className="destaqueColecoes1">
                        <div className="divImagem">
                            <a href="/produtos"><img src={pants} className="colecoes" alt="Calça" /></a>
                        </div>
                        <p className="itensDestaque">Calças</p>
                    </div>

                    <div className="destaqueColecoes1">
                        <div className="divImagem">
                            <a href="/produtos"><img src={pants} className="colecoes" alt="Boné" /></a>
                        </div>
                        <p className="itensDestaque">Bonés</p>
                    </div>

                    <div className="destaqueColecoes1">
                        <div className="divImagem">
                            <a href="/produtos"><img src={smallheadphone} className="colecoes" alt="Headphones" /></a>
                        </div>
                        <p className="itensDestaque">Headphones</p>
                    </div>

                    <div className="destaqueColecoes1">
                        <div className="divImagem">
                            <a href="/produtos"><img src={sneakers} className="colecoes" alt="Tênis" /></a>
                        </div>
                        <p className="itensDestaque">Tênis</p>
                    </div>
                </div>
            </section>
        </>
    );
}


